If inline build is heavy, we can try to layer the dependencies: { "name": "ppd", "description": "my python layer", "runtime": { "lang": "python3.10", "package_type": "zip", "handler": "handler.handler", "layers": ["ppd-layer"] }, "build": { "pre": [ "yum install -y git", "yum install -y gcc gcc-c++" ], "kind": "Layer", }
} Note that we have specified the list of layers the function uses. The layer itself can be built independent of the function, unlike Inline build kind. tc build --kind layer
tc publish --name ppd-layer We can then create or update the function with this layer. At times, we may want to update just the layers in an existing sandboxed function tc update -s <sandbox> -e <env> -c layers Info AWS has a limit on the number of layers and size of each zipped layer. tc automatically splits the layer into chunks if it exceeds the size limit (and still within the upper total limit of 256MB)
